import React from 'react'
import Axios from 'axios'

class movielist extends React.Component{
    state = {
        data : []
    }
    componentDidMount(){
        this.getDataMovies()
    }
    getDataMovies = () => {
        Axios.get("http://localhost:2000/movies")
        .then((result)=>{
            
            this.setState({
                data : result.data 
            })
            
        })
        .catch((error) => {
            console.log(error)
        })
    }
    printMovieData = () => {
        this.state.data.map((val) => {
            return(
                <div>{val}</div>
            )
        })
    }
    render(){
        return (
            <div className='container mt-5'>
                <div className="row">
                    <div className="col-md-3 mycard">
                        <img src="https://media.21cineplex.com/webcontent/gallery/pictures/156074568118284_452x647.jpg" alt='MovieImage' width='100%'/>
                        <p> {this.printMovieData()}  </p>
                    </div>
                </div>    
                          
            </div>
        )
    }
}

export default movielist;
